import React, { useState } from "react";
import axios from 'axios';

// reactstrap components
import { Button, Container, Row, Col } from "reactstrap";

import { Link } from "react-router-dom";
// core components
import ExamplesNavbar from "components/Navbars/ExamplesNavbar.js";
import DarkFooter from "components/Footers/DarkFooter.js";

function CampingPage() {
  const [names,setNames]=useState([]);
  const [nums,setNums]=useState([]); 
  let array1={} ;
  let array2={} ;
  let array3={} ;
  let array4={};
  let array5={};

  React.useEffect(() => {
    let isSubscribed = true;
    axios
    .get(
      '/api/getpicture'
    )
    .then(Response => {
      
      if (Response.status === 200) {
            
        setNames(Response.data.response.body.items.item);
        console.log(Response.data.response.body.items.item);
       // check if this component still mounted
       if (isSubscribed) {
         //setLoading(false);
       }
     }
    });
    //.catch((Error)=>{console.log(Error)});
      
    document.body.classList.add("camping-page");
    document.body.classList.add("sidebar-collapse");
    document.documentElement.classList.remove("nav-open");
    window.scrollTo(0, 0);
    document.body.scrollTop = 0;
    return function cleanup() {
      document.body.classList.remove("camping-page");
      document.body.classList.remove("sidebar-collapse");
    };
  }, []);
  const Namelists= names.map((name,index)=> {
    return(<div>
      {  
        nums.map((i,index2)=> {
          if(index == i){
       // setLocation([locationss,name]);
     if(index2 === 0){
       array1 = name
     }else if(index2 ===1){
      array2 = name
     }
     else if(index2 ===2){
      array3 = name
    }else if(index2 ===3){
      array4 = name
    }else if(index2 ===4){
      array5 = name
    }
           const searchurl="https://search.daum.net/search??w=tot&&q="+ name.trrsrtNm
           const mapurl="https://map.kakao.com/link/to/,"+name.trrsrtNm+"," +name.latitude+","+name.longitude
           const link = "/suggestdetail/"+ name.trrsrtNm

        return(
          <div className="section3 section-nucleo-icons">
    
          <Container>
              <Row key={index}>
                 {/* <h5> {name.rdnmadr.split(" ")[0]}</h5>  */}
                <Col lg="6" md="12">
                  <h2 className="title">{name.trrsrtNm}  <div className="suggestdetail"><Link to={link} > +사진</Link></div></h2>
                 <h5 className="description">
                    {name.trrsrtIntrcn}
                  </h5>
                  <Button
                    className="btn-detail"
                    color="info"
                    size="lg"
                    href = {searchurl}
                    target="_blank"
                  > 자세히
                  </Button>
                  <Button
                    className="btn-direction"
                    color="info"
                    href={mapurl}
                    outline
                    size="lg"
                    target="_blank"
                  >
                    길찾기
                  </Button>
                </Col>
              </Row>
            </Container>
          </div>
       );
      }
        })
      }
      </div>
    )
  }
);


  return (
    <><>
      <ExamplesNavbar />
      <div className="page-header clear-filter">
        <div
          className="page-header-image"
          style={{
            backgroundImage: "url(" + require("assets/img/login1.jpg").default + ")",
          }}
        ></div>
      </div>



      </><div class="zone_wrap">
        <div class="list_zone">
          <div class="tit">
            <h2 id="zoneTitle">캠핑여행</h2>
          </div>
          <div className="array1">{array1.trrsrtNm}</div>
          <div className="array2">{array2.trrsrtNm}</div>
          <div className="array3">{array3.trrsrtNm}</div>
          <div className="array4">{array4.trrsrtNm}</div>
          <div className="array5">{array5.trrsrtNm}</div>
          {Namelists}
      <DarkFooter />
      
      </div>
      </div></>
  );
}

export default CampingPage;
